import React, { useEffect } from 'react'
import { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import BackgroundImage from '../images/map-of-nyc.png'
import '../styles/Landing.css'
import ApartmentView from './ApartmentView'
import { Link } from 'react-router-dom'
import GooglePlacesAutocomplete from 'react-google-places-autocomplete'
import AutoSearch from './AutoSearch'

export default function Landing(props) {
    console.log('in landing',)
    let navigate = useNavigate()

    const [address, setAddress] = useState('')
    const [coordinates, setCoordinates] = useState({
        lat: null,
        lng: null,
    });

    const handleSubmit = (e) => {
        e.preventDefault()
        props.updateAddress(address)
        localStorage.setItem("address", address)
        console.log('in landing.js', address)
        navigate('/apartment-view')
    }

    useEffect(() => {
        // props.updateAddress(address)
        // props.updateCoordinates(coordinates)
        props.updateAddress(localStorage.getItem('address'))
        props.updateCoordinates(localStorage.getItem('coords'))
    }, [address])

    function updateAddress(addressFromAutoSearch) {
        // props.updateAddress(addressFromAutoSearch) //sending it up to App.js
        console.log('getting child address in landing.js:', addressFromAutoSearch)
        setAddress(address => addressFromAutoSearch)
        props.updateAddress(address)
    }

    function updateCoordinates(coordinatesFromAutoSearch) {
        // props.updateCoordinates(coordinatesFromAutoSearch) //sending it up to App.js
        console.log('getting child coordinates in landing.js:', coordinatesFromAutoSearch)
        setCoordinates(coordinates => ({
            lat: coordinatesFromAutoSearch.lat,
            lng: coordinatesFromAutoSearch.lng
        }));
        props.updateCoordinates(coordinates)
    }

    return (

        <div className='landing-page'>

            <div>
                <img className='landing-background' src={BackgroundImage} />
            </div>

            <div className='landing-search'>
                <h1 className='landing-title'>DROP-IN</h1>

                <AutoSearch updateAddress={updateAddress} updateCoordinates={updateCoordinates} />

            </div>

        </div >

    )
}
